import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../UI/css/header.css";
import { logout } from "../utils/auth";
import GridViewOutlinedIcon from "@mui/icons-material/GridViewOutlined";
import VideoCameraFrontOutlinedIcon from "@mui/icons-material/VideoCameraFrontOutlined";
import ChatOutlinedIcon from "@mui/icons-material/ChatOutlined";
import FolderOutlinedIcon from "@mui/icons-material/FolderOutlined";
import CalendarMonthOutlinedIcon from "@mui/icons-material/CalendarMonthOutlined";
import { getActions } from "../../store/actions/authActions";
import { Sidebar, Menu, MenuItem } from "react-pro-sidebar";
import Room from "../../Dashboard/Room/Room";
import Lecture from "../../Dashboard/Lecture/Lecture";
import { connect } from "react-redux";
import { connectWithSocketServer } from "../../realtimeCommunication/socketConnection";
import { useParams } from "react-router-dom";

const DashboardNavigation = ({
  subjects,
  setUserDetails,
  room,
  socketOpen,
  isClicked,
  setIsClicked,
}) => {
  const [isLoading, setIsLoading] = useState(false);
  const isUserInRoom = room.isUserInRoom;

  useEffect(() => {
    const userDetails = localStorage.getItem("user");

    if (!userDetails) {
      logout();
    } else {
      const parsedUserDetails = JSON.parse(userDetails);
      setUserDetails(parsedUserDetails);
      if (!socketOpen && !subjects.subjects.length) {
        connectWithSocketServer(parsedUserDetails);
      }
      setIsLoading(false);
    }

    const handleOutsideClick = (e) => {
      if (isClicked && !e.target.closest(".navUl")) {
        setIsClicked(false);
      }
    };
    document.addEventListener("click", handleOutsideClick);
    return () => {
      document.removeEventListener("click", handleOutsideClick);
    };
  }, [
    isClicked,
    setIsClicked,
    setUserDetails,
    socketOpen,
    subjects.subjects.length,
  ]);
  const { id } = useParams();

  const subject = subjects.subjects.find((subject) => subject.code === id);
  const components = {
    lecture: isUserInRoom ? <Room /> : <Lecture subjectId={subject.id} />,
    chat: null,
    files: null,
    calendar: null,
  };

  return (
    <div className="navigation">
      <ul className={isClicked ? "navUl-active" : "navUl"}>
        <li>
          <Link className="a" to="/">
            Home
          </Link>
        </li>
        <li>
          <Link className="a" to="/" onClick={logout}>
            Logout
          </Link>
        </li>
        <Sidebar
          className="mobileSidebar"
          style={{
            backgroundColor: "white",
            marginTop: "1px",
            display: "flex",
            flexDirection: "row",
          }}>
          <Menu>
            <MenuItem
              className="menu-item"
              component={<Link to="/dashboard" />}
              icon={<GridViewOutlinedIcon />}>
              Dashboard
            </MenuItem>
            <MenuItem
              className="menu-item"
              icon={<VideoCameraFrontOutlinedIcon />}
              onClick={() => {
                setSelectMenuItem("lecture");
              }}>
              Lecture
            </MenuItem>
            <MenuItem
              className="menu-item"
              icon={<ChatOutlinedIcon />}
              onClick={() => setSelectMenuItem("chat")}>
              Chat
            </MenuItem>
            <MenuItem
              className="menu-item"
              icon={<FolderOutlinedIcon />}
              onClick={() => setSelectMenuItem("files")}>
              Files
            </MenuItem>
            <MenuItem
              className="menu-item"
              icon={<CalendarMonthOutlinedIcon />}
              onClick={() => setSelectMenuItem("calendar")}>
              Calendar
            </MenuItem>
          </Menu>
        </Sidebar>
        {components[selectMenuItem]}
      </ul>
    </div>
  );
};

const mapStoreStateToProps = ({ room, subjects, socket }) => {
  return {
    subjects,
    room,
    socketOpen: socket.socketOpen,
  };
};

const mapActionsToProps = (dispatch) => {
  return {
    ...getActions(dispatch),
  };
};

export default connect(
  mapStoreStateToProps,
  mapActionsToProps
)(DashboardNavigation);
